import React, { Component } from 'react'
import Img from "./img.jpg"

class Gallery extends Component {
    render() {
        return (
            <div className="items">
                <div className="item">
                <img src={Img} width="640" height="426" />
                </div>
            </div>
        )
    }
}

export default Gallery
